import React from "react";
import '../components_css/LoginForm.css';
function LoginForm(){
    return(
        <div className="login-container">
            <input type='text' id="id" name="id" placeholder="아이디를 입력해주세요" className="input-id"></input>
            <input type='text' id="pw" name="pw" placeholder="비밀번호를 입력해주세요" className="input-pw"></input>
            <button className="login-btn">로그인</button>
        </div>

    );

}

export default LoginForm;
